import React, { Component } from "react";

class Image extends Component {
	render() {
		const myStyle = {
			backgroundImage:
				"url('https://media.istockphoto.com/id/165505058/vector/landscape.jpg?s=1024x1024&w=is&k=20&c=TwR9wVU_dxMWNll9eXU4_0xviDRC0oaoZWVqFX0tiTw=')",
			height: "100vh",
			marginTop: "-70px",
			fontSize: "50px",
			backgroundSize: "cover",
			backgroundRepeat: "no-repeat",
		};
		return (
			<div style={myStyle}>
				<h1> IT PROFESSIONAL </h1>
			</div>
		);
	}
}

export default Image;
